import React from 'react'
import Banner from './Banner.js';
import './Homescreen.css'
import Navbar from './Navbar.js';
import Row from './Row.js';

function Homescreen() {
  return (
    <div className='homescreen'>
         <Navbar/>
         <Banner/>
         <Row/>
      </div>
  )
}

export default Homescreen;
